using ObjectiveC;using System;using SwiftSharp.Attributes;using Foundation;namespace UIKit{	//https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UILexiconEntry_Class/index.html#//apple_ref/occ/cl/UILexiconEntry	/// <summary>	/// A lexicon entry specifies a read-only term pair, available within a UILexicon object, for use by a custom keyboard.	/// </summary>	[iOSVersion(8)]	public class UILexiconEntry : NSObject	{		/// <summary>		/// Text to be inserted into a text input object by a custom keyboard, corresponding to the userInput value in the same lexicon entry.		/// </summary>		[iOSVersion(8)]		[Export("documentText")]		public string DocumentText { get; private set; }				/// <summary>		/// Text to match, during user input, to provide appropriate output to a text document from the documentText value in the same lexicon entry.		/// </summary>		[iOSVersion(8)]		[Export("userInput")]		public string UserInput { get; private set; }	}}